import React from 'react';
// import 'bootstrap/dist/css/bootstrap.min.css';
import SideNav from './Sidenav';
const educationData = [
  {
    institution: 'University of ABC',
    degree: 'Bachelor of Science in Computer Science',
    courses: ['Introduction to Programming', 'Data Structures', 'Algorithm Design'],
  },
  {
    institution: 'XYZ Technical Institute',
    degree: 'Master of Science in Software Engineering',
    courses: ['Advanced Software Development', 'Distributed Systems', 'Formal Methods'],
  },
  // Add more education entries as needed
];

const Education = () => {
  return (
    <>
    <div className="container mt-5">
      <h2>Education</h2>
      {educationData.map((education, index) => (
        <div key={index} className="card mt-3">
          <div className="card-body">
            <h5 className="card-title">{education.institution}</h5>
            <p className="card-text">{education.degree}</p>
            <ul>
              {education.courses.map((course, i) => (
                <li key={i}>{course}</li>
              ))}
            </ul>
          </div>
        </div>
      ))}
    </div>
    </>
  );
};

export default Education;
